import NoticeContext from "./NoticeContext";

const NoticeState = () =>{
    const state = {
        'name' : 'Nischal',
        'class': '55'
    }

    return(
        <NoticeContext.provider value={state}>
            {props.children}
        </NoticeContext.provider>
    )
}

export default noticeState;
